public class Solution {
    public string MinWindow(string s, string t)
    {
        int l = 0;
        char[] sArray = s.ToCharArray();
        int resultStart = 0;
        int resultLen = int.MaxValue;

        var window = new Dictionary<char, int>();
        var TCounts = new Dictionary<char, int>();

        //Populate TCounts
        foreach (var character in t)
        {
            TCounts.TryAdd(character, 0);
            TCounts[character]++;
        }
        
        int have = 0, need = TCounts.Count();

        for (int r = 0; r < s.Length; r++)
        {
            char currentChar = s[r];
            window.TryAdd(currentChar, 0);
            window[currentChar]++;

            if (TCounts.ContainsKey(currentChar) && window[currentChar] == TCounts[currentChar])
            {
                have++;
            }

            while (have == need)
            {
                if (r - l + 1 < resultLen)
                {
                    resultLen = r - l + 1;
                    resultStart = l;
                }
                //Pop first element from map
                window[s[l]]--;
                if (TCounts.ContainsKey(s[l]) && window[s[l]] < TCounts[s[l]])
                {
                    have--;
                }

                l++;
            }
        }

        if (resultLen != int.MaxValue)
        {
            return s.Substring(resultStart, resultLen);
        }
        else
        {
            return string.Empty;
        }
    }
}